create table [Order]
(
    Id             varchar(36)    default newid()      not null
        constraint Order_pk
            primary key nonclustered,
    CreatedDate    datetimeoffset default getutcdate() not null,
    ModifiedDate   datetimeoffset default NULL,
    DeletedDate    datetimeoffset default NULL,
    State          nvarchar(36),
    CustomerId     varchar(36),
    EmployeeId     varchar(36)                         not null,
    OrderDate      datetime                            not null,
    RequiredDate   datetime                            not null,
    ShippedDate    datetime,
    ShipperId      varchar(36)                         not null,
    Freight        decimal(13, 2)                      not null,
    ShipName       varchar(40)                         not null,
    ShipAddress    varchar(60)                         not null,
    ShipCity       varchar(15)                         not null,
    ShipRegion     varchar(15),
    ShipPostalCode varchar(10),
    ShipCountry    varchar(15)                         not null
)
go

